actionConfiguration.body:
() => {
  let search = [];
  const sea = CALLER_LEADS.data.find(NUMBER => NUMBER.PHONE_NUMBER == C_Search.text);
  search.push(sea);
  if (search[0] != null) {
    showModal("L_Details");
  } else {
    showAlert("Number Not Exist");
  }
  return search;
}

